package io.polywrap.configBuilder.embeds

import io.polywrap.core.WrapPackage
import io.polywrap.wasm.WasmPackage
import okio.ByteString.Companion.decodeBase64

fun getIpfsResolverWrap(): WrapPackage {
    val wrapWasmBase64 =
        ""

    val wrapInfoBase64 = ""

    val module: ByteArray = wrapWasmBase64.decodeBase64()!!.toByteArray()
    val manifest: ByteArray = wrapInfoBase64.decodeBase64()!!.toByteArray()

    return WasmPackage(manifest, module)
}
